import React from "react";

function List() {
    return (
        <ul>
        <li>Lorem</li>
        <li>Ipsum</li>
        <li>Dolor</li>
        <li>More lorem</li>
        <li>Some other ipsum</li>
      </ul>
    ) 
}

export default List
